import { Link } from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return (
    <div>
      <link to="/">Home</link>
      <link to="/">About Us</link>
      <link to="/">Contact Us</link>

    </div>
  );
}

export default App;
